import productsData from "./Product";

export default function Main(){
    return(
        <div className="main">
            {productsData.map((el) => {
                return(
                    <div key={el.id} className = ''>
                        <div className="card">
                            <img src={ "/"+ el.imageURL} alt="No data" className="images" />
                            <div className="text_box">
                                <h4>{el.title}</h4>
                                <p>{el.price}</p>
                                <p>{el.description}</p>
                            </div>
                        </div>
                    </div>
                )
            })}
        </div>
    )
}
